import React, { Component } from 'react';
import shareScreen from '../../pictures/sharescreen.png';
import stopShare from '../../pictures/stopshare.png';



class Page4 extends Component {
    handleScroll=()=>{
        window.scroll({top:0,behavior:'smooth'})
    
    }
    componentDidMount() {
        this.handleScroll()
  }
    render() {
        return (
            <div className="sheet">
                <h1 id="p4title" className="bold center">Icebreaker</h1>
                <div id="page4" className="left container_for_medium_margin">
                    <p>I think it would be fun to get to know more about each other. </p>
                    <div id="instruction_box_number_1_page_4_sheet_2" className="ital custom_svg demo_box container_for_small_margin">
                        <img className="in_inst" src={shareScreen} alt="Share Screen" id="shareScreen4" />
                        <h2 className="top_line_in_instruction_box other_text_in_instruction_box">Click on the [link to be inserted] and</h2>
                        <br/><br/>
                        <h2 className='other_text_in_instruction_box'>share your screen.</h2>
                        <br/><br/><br/><br/><br/>
                        <h2 className='other_text_in_instruction_box'>Take turns picking question to ask each other in the XXX game. </h2>
                    </div>
                    <br /><br />
                    <h2>We will click on the boxes. A question will show up in the box and we will both answer it. </h2>
                    <h2>If you also have a question that isnâ€™t in game, but you really want to ask me, just let me know! </h2>
                    <br /><br /><br /><br /><br /><br /><br /><br /><br /><br /><br /><br />
                    <div id="inst_2_4" className="ital custom_svg demo_box">
                        <h2 className="in_inst">When you are done with the game, stop screen sharing</h2>
                        <br/><br/>
                        <img src={stopShare} alt="Stop share" id="stopShare4" className="in_inst" />
                    </div>
                </div>
            </div>
        )
    }
}
export default Page4;

